function galleryController(n,t,i,r){n.images=i;n.index=r;n.selectedImage={};n.init=function(){n.selectedImage=n.images[n.index]};n.cancel=function(){t.close()};n.showNext=function(){n.index===n.images.length-1?n.index=0:n.index++;n.init()};n.showPrevious=function(){n.index===0?n.index=n.images.length-1:n.index--;n.init()};n.init()}app.controller("galleryController",["$scope","$uibModalInstance","images","index",galleryController]);